                    type="text"
                  />
                </td>
              </tr>
              <tr>
                <td>
                  <label></label>
                </td>
                <td>
                  <input

                    type="text"
                  />
                </td>
              </tr>
              <tr>
                <td>
                  <label></label>
                </td>
                <td>
                  <input

                    type="text"
                  />
                </td>
              </tr>
              <tr>
                <td>
                  <label></label>
                </td>
                <td>
                  <input

                    type="text"
                  />
                </td>
              </tr>
            </tbody>
          </table>
          <button className="btn btn-success" onClick={registrarProvedores}>
            Registrar
          </button>
        </div>

          </div>
          <div class="card-footer text-body-secondary"></div>
        </div>
      </div>
    </main>
  );
}

export default Proveedores;
